import React from "react";
import Board from "./Board";


class Game extends React.Component {

    private _word: string = "";
    private _word_length: number = 0;


    componentDidMount(){
        this._word = "Bonjourss";
        this._word_length = this._word.length;

    }

    render(){

        return (
            <div>
                <Board word_length={this._word_length} word={this._word} />
                {console.log(this._word, this._word_length)}
            </div>
        );
    }


}

export default Game;
